import React, { Component } from 'react'
import axios from 'axios'

class TodoList extends Component {
    state = {
        todos: []
    }

    componentDidMount() {
        axios.get('http://localhost:5000')
            .then(res => {
                this.setState({
                    todos: res.data
                })
            })
            .catch(error => console.log(`Error fetch API ${error}`))
    }
    render() {
        let { todos } = this.state
        return (
            <div className="container">
                <p>Welcome to Todo List Component</p>
                {todos.map(todo => (
                    <div className="card border-dark mb-3" key={todo._id} >
                        <div className="card-header">Todo</div>
                        <div className="card-body text-dark">
                            <h5 classna="card-title">Title: {todo.discription}</h5>
                            <p class="card-text">Info: {todo.responsible}</p>
                            <p class="card-text">Priority {todo.priority}</p>
                            <p class="card-text">isCompleted: {todo.isCompleted}</p>

                        </div>
                    </div>
                ))}
            </div>
        )
    }
}

export default TodoList
